import React from "react";

function ParsedData({ data }) {
  const parsedJSON = JSON.parse(data);

  return (
    <div className="parsed-data">
      <h2>Parsed Resume Data</h2>
      <pre>{JSON.stringify(parsedJSON, null, 2)}</pre>
    </div>
  );
}

export default ParsedData;
